メーカー希望小売価格はメーカーカタログに基づいて掲載しています
<br><br>

<B>日本製 レザークラフト スマートキーケース（全2色）<BR>
当店大人気のスマートキーケースから、高級レザーキーケースが登場！！！</B><BR>
<BR>
高級で丈夫な牛革を、日本人の革職人の手によりデザイン＆縫製を施すことで、ひとつひとつ丁寧に仕上げました。<BR>
デザイン的には、ワンポイントのオーバーレイ（重ね合わせ）を採用することで、シンプルな中にも存在感があるキーケースです。<BR>
<BR>大切な愛車のスマートキーを、落下や衝撃による外傷から守るのに最適。<BR>
また、高級牛革独特の使い込むほどに深みや年季が増していく過程まで楽しむことができます。<BR>
<BR>
<BR>
【素材について】<BR>
<BR>
<B>■ナチュラルのレザー</B><BR><BR>
<FONT color="#ff0000">使い込むほどに味わいが増す<BR>
高級牛革使用のスマートキー用ケース</FONT> <BR>
<BR>
アメリカの老舗タンナー（なめし革業者）であるハンマーオーク社の牛革を使用し、ひとつひとつ日本国内の職人による手縫いで仕上げた、こだわりのスマートキー用のキーケース。<br>使用している牛革は、ツーリングレザーやヌメ革と呼ばれる、革本来の良さが楽しめる高級かつ最もナチュラルな素材。<BR>
その中でも「ベンズ」という牛の背中&#12316;臀部に掛けての部位のみを厳選してチョイス。ちなみにこの部位は、革の繊維密度が非常に高く、また繊維自体も締まっているので、革質に優れていることが特徴。<BR>
他の部位と比較し強度や耐久性が高く、ズボンのベルトやサドル馬具などに使われることが多いことで有名です。<BR>
<BR>
<BR>
<B>■黒のレザー</B><BR><BR>
<FONT color="#ff0000">縫製、デザイン、そしてタンナーまで<BR>
純国産にこだわったスマートキーケース</FONT><BR>
<BR>
牛革製品の素材は、輸入品の方がポピュラーという雰囲気がりますが、何を隠そう国産品も侮れません。<BR>
あまり知られてはいませんが、日本のタンナー（なめし革業者）としての歴史は非常に古く、弥生時代には大陸からの帰化人が鞣製技術を伝えたとされ、江戸時代には全国的に牛革や馬革が広く使われるようになったとされています。<BR>
そんな日本 革文化のなかで、国産牛革 シェアでブッチギリのトップなのは、栃木レザーで有名な栃木産ではなく兵庫県姫路産。<br>その量は、出荷額では約50%を、成牛革の出荷量ではなんと70%を誇るほどです。<BR>
弥生時代から脈々と伝わるタンナーの技術により、全国に最高級の国産牛革を供給し続ける姫路レザーは、隠れた名品。<BR>
そんな姫路レザーの「ベンズ」という、牛の背中～臀部に掛けての、繊維密度が高く革質に優れる部位を使用したスマートキー用キーケースがこちら。<BR>
もちろん、デザインや縫製に至るまで、日本人の職人の手でひとつひとつ丁寧に仕上げています。<BR>
<BR>
プレゼント包装も無料で行っています！<BR>
普段からお世話になっている方へのプレゼントにも最適です！！  <BR>
<BR>
